/**
 * widget для бокового меню
 */
function widgetDev() {
    $('.widget_wrap').hoverIntent({
        over: makeHoverWidgetTall,
        out: makeHoverWidgetShort,
        timeout: 300,
        interval: 50
    })

    function makeHoverWidgetTall() {
        $(this).addClass('widget_active')
    }

    function makeHoverWidgetShort() {
        $(this).removeClass('widget_active')
    }

    $(document).on('touchstart', '.widget_wrap', function (e) {
        if (this.offsetWidth - event.offsetX < 0) {
            $('.widget_wrap').toggleClass('widget_active')
        }
    })
}

/* script для фиксирования шапки при скролле */

function newHeaderFix() {
    if ( $('.header_new_topline').length === 0) {
        return false
    }

    var w = $(window).width()
    var a = $('.header_new_topline').position().top
    var b = +a - 42
    var $windowScrot = $(window)
    $windowScrot.scroll(function () {
        if ($(this).scrollTop() > a) {
            $('body').addClass('new_h_fix')
        } else {
            $('body').removeClass('new_h_fix')
        }
    })

    if ($windowScrot.scrollTop() > a) {
        $('body').addClass('new_h_fix')
    } else {
        $('body').removeClass('new_h_fix')
    }
}

function openJivoSiteMobile() {
    $('.js_jivo_open_button').click(function () {
        $('.jivo_mobile').show()
    })
    $('.jivo_wrapios_removeText').click(function () {
        $('.jivo_mobile').hide()
    })
    $('.jivo_back').mouseup(function () {
        $('.jivo_mobile').hide()
    })
}

function headerSearchOpener() {
    $('.elem_mob_search, .search-close-btn').click(function () {
        toggleSearchPanel();
    })

    function toggleSearchPanel() {
        $('.elem.elem_search').toggleClass('open');
        $('.elem_bars').removeClass('active');
        $('html, body').removeClass('noscroll');
        $('.header_new_topline_menu').removeClass('block');
        $('#query_autocomplite').focus();
    }
}

function openFilterMobile() {
    $('.js-openfilter').click(function () {
        $('.ncatfilter form').addClass('active')
        mSearch2.filterModalOpen = true
    })
    $('.js-close-filter').click(function () {
        mSearch2.filterModalOpen = false
        mSearch2.submit()
        setTimeout(function () {
            $('.ncatfilter form').removeClass('active')
        }, 500)
    })
}

function openMobileBottomHeader() {

    $('.little_mobile_line_close').click(function () {
        $('.menu_show_wrapper_menu').removeClass('active open')
        $('body').removeClass('active_menu')
    })


    $('.elem_bars').click(function () {
        $('html, body').toggleClass('noscroll')
        $('.elem_bars').toggleClass('active')
        $('.header_new_topline_menu').toggleClass('block')
        $('.elem.elem_search').removeClass('open');
    })


    $('.little_mobile_line_close').click(function () {
        $('.elem_bars').removeClass('active')
        $('html, body').removeClass('noscroll')
        $('.header_new_topline_menu').removeClass('block')
        $('.elem.elem_search').removeClass('open');
    })

    /**
     * Нажатие на кнопку "Каталог"
     */

    $('.js_open_nav_category').click(function () {
        megaMenuSwitch.call(this,'toggle')
    })

    $(document).on('click', '.modal-megamenu', function (e) {
        e.preventDefault();
        megaMenuSwitch.call(this,'close')
    })
}

