function listFilterCleanProduct() {
	var page = $('.main_filters').length
	if (page) {
		var a = $('.main_filters').offset().left;
		var w = $('.main_filters').width();
		var b = +a + 0;
		var a2 = $('.main_filters').offset().top;
		var a3 = $('.main_filters').height();
		$('.clean_filters').css({ 'left': b, 'width': w });
		$(window).scroll(function () {
			var g2 = $('.newfilterj').height();
			var g1 = $('.newfilterj').offset().top;
			var g3 = +g2 - g1 - 270;
			if ($(this).scrollTop() > g3) {
				$('.clean_filters').addClass('active');
			} else {
				$('.clean_filters').removeClass('active');
			};
		});
	}
}

$(document).ready(function () {
	listFilterCleanProduct()
})

