String.prototype.translit = String.prototype.translit || function () {
    var str = this
    var replace = ''
    var replacer = {
        'q': 'й',
        'w': 'ц',
        'e': 'у',
        'r': 'к',
        't': 'е',
        'y': 'н',
        'u': 'г',
        'i': 'ш',
        'o': 'щ',
        'p': 'з',
        '[': 'х', ']': 'ъ',
        'a': 'ф',
        's': 'ы',
        'd': 'в',
        'f': 'а',
        'g': 'п',
        'h': 'р',
        'j': 'о',
        'k': 'л',
        'l': 'д',
        ';': 'ж',
        '\'':
            'э',
        'z': 'я',
        'x': 'ч',
        'c': 'с',
        'v': 'м',
        'b': 'и',
        'n': 'т',
        'm': 'ь',
        ',': 'б',
        '.': 'ю',
        '/': '.'
    }

    var newReplacer = swapString(replacer)
    for (var i = 0; i < str.length; i++) {
        if (replacer[str[i].toLowerCase()] !== undefined) {
            if (str[i] === str[i].toLowerCase()) {
                replace = replacer[str[i].toLowerCase()]
            } else if (str[i] === str[i].toUpperCase()) {
                replace = replacer[str[i].toLowerCase()].toUpperCase()
            }
            str = str.replace(str[i], replace)
        }
    }
    return str
}
String.prototype.translitBack = String.prototype.translitBack || function () {
    var str = this
    var replace = ''
    var replacer = swapString({
        'q': 'й',
        'w': 'ц',
        'e': 'у',
        'r': 'к',
        't': 'е',
        'y': 'н',
        'u': 'г',
        'i': 'ш',
        'o': 'щ',
        'p': 'з',
        '[': 'х', ']': 'ъ',
        'a': 'ф',
        's': 'ы',
        'd': 'в',
        'f': 'а',
        'g': 'п',
        'h': 'р',
        'j': 'о',
        'k': 'л',
        'l': 'д',
        ';': 'ж',
        '\'':
            'э',
        'z': 'я',
        'x': 'ч',
        'c': 'с',
        'v': 'м',
        'b': 'и',
        'n': 'т',
        'm': 'ь',
        ',': 'б',
        '.': 'ю',
        '/': '.'
    })
    for (var i = 0; i < str.length; i++) {
        if (replacer[str[i].toLowerCase()] !== undefined) {
            if (str[i] === str[i].toLowerCase()) {
                replace = replacer[str[i].toLowerCase()]
            } else if (str[i] === str[i].toUpperCase()) {
                replace = replacer[str[i].toLowerCase()].toUpperCase()
            }
            str = str.replace(str[i], replace)
        }
    }
    return str
}

function swapString (obj) {
    var res = {}
    Object.keys(obj).forEach(function (value) {
        var key = obj[value]
        res[key] = value
    })
    return res
}


(function ($) {
    $.fn.findCheckList = function () {

        var filterByName = '';
        var inputs = this
        for (var i = 0; i < inputs.length; i += 1) {
            $(inputs[i]).closest('.ncatfilterun').find('.btn_reset_search').on('click', '', clearInput)
            inputs[i].addEventListener('keyup', keyupHandler)
        }

        function clearInput () {
            var $input = $(this).closest('.ncatfilterun').find('.terms_filter_input')
            $input.val('')
            keyupHandler.call(this)
        }

        function keyupHandler () {
            var terms_filter = $(this).closest('.ncatfilterun').find('fieldset')
            var check_wrap = $(this).closest('.ncatfilterun').find('fieldset')
            var btn_reset_search = $(this).closest('.ncatfilterun').find('.btn_reset_search')
            var filterItems = terms_filter.find('.fl_chek')

            filterByName = this.value
            var label = {}
            var the_tit, text = ''
            var countVisible = 0
            for (var i = 0; i < filterItems.length; i++) {
                if (!filterItems.hasOwnProperty(i)) {
                    continue
                }
                label = filterItems[i]
                text = $(label).find('span').text()
                if (search(text)) {
                    countVisible++
                    label.style.display = ''
                } else {
                    label.style.display = 'none'
                }
            }

            check_wrap.find('.terms_filter_empty_results').remove()
            if (countVisible === 0) {
                var emptyText = document.createElement('div')
                emptyText.classList.add('terms_filter_empty_results')
                emptyText.innerHTML = 'По вашемо запросу ничего не найдено'
                check_wrap.append(emptyText)
            }

            if (filterByName.length > 0) {
                btn_reset_search.show()
            } else {
                btn_reset_search.hide()
            }

        }

        function search (text) {
            if (filterByName.length === 0) {
                return true
            }
            var label = text.toString().toLowerCase()
            return (label.indexOf(filterByName.toLowerCase()) > -1 || label.indexOf(filterByName.translit().toLowerCase()) > -1 || label.indexOf(filterByName.translitBack().toLowerCase()) > -1)
        }

        return this;
    };
}(jQuery));
