(function ($) {
    $.fn.filterNoUiSlider = function () {

        var sliders = this
        for (var i = 0; i < sliders.length; i += 1) {
            init.call(sliders[i])
        }

        function init () {

            var self = this

            var filter = this.getAttribute('data-filter')
            var container = this.closest('.ncatslrange')
            var inputs = [container.querySelector('.slider-input-min'), container.querySelector('.slider-input-max')]

            // Имя поля
            var name = inputs[0].getAttribute('name')

            var debug = false

            if (!inputs[1]) {
                return true
            }

            var min = parseInt(inputs[0].getAttribute('data-current-value'))
            var min_start = parseInt(inputs[0].getAttribute('value'))
            var max = parseInt(inputs[1].getAttribute('data-current-value'))
            var max_start = parseInt(inputs[1].getAttribute('value'))

            // Если что то введено в адресную строку то устаналиваем что это сделал пользователь
            var changed = mSearch2.Hash.get()[name] !== undefined
            mSearch2.sliders[name] = {
                changed: changed,
                user_changed: changed
            }

            // Установка значения из заголовка
            var values = mSearch2.Hash.get()

            if (debug) {
                console.log(min_start)
            }

            if (values[name]) {
                var tmp = values[name].split(mse2Config['values_delimeter'])
                if (tmp[0].match(/(?!^-)[^0-9\.]/g)) {
                    tmp[0] = tmp[0].replace(/(?!^-)[^0-9\.]/g, '')
                }
                if (tmp.length > 1) {
                    if (tmp[1].match(/(?!^-)[^0-9\.]/g)) {
                        tmp[1] = tmp[1].replace(/(?!^-)[^0-9\.]/g, '')
                    }
                }
                min_start = tmp[0]
                max_start = tmp.length > 1 ? tmp[1] : tmp[0]
            }

            min_start = parseInt(min_start)
            max_start = parseInt(max_start)

            if (debug) {
                console.log('start min ' + min + ' max ' + max)
                console.log('start min_start ' + min_start + ' max_start ' + max_start)
            }

            var ranges_values = ranges(min, max)
            if (debug) {
                console.log(ranges_values)
            }

            noUiSlider.create(this, {
                start: [min_start, max_start],
                connect: true,
                range: ranges_values,
                format: {
                    to: function (value) {
                        return parseInt(value)
                    },
                    from: function (value) {
                        return parseInt(value)
                    }
                }
            })

            this.noUiSlider.on('update', function (values, handle) {
                if (debug) {
                    console.log('update')
                }
                // Записываем только если были внесены изменения
                if (mSearch2.sliders[name].changed || mSearch2.sliders[name].user_changed) {
                    inputs[handle].value = values[handle]
                }
            })

            this.noUiSlider.on('slide', function (values, handle) {
                if (debug) {
                    console.log('slide')
                }
                // Записываем только если были внесены изменения
                if (!mSearch2.sliders[name].user_changed) {
                    mSearch2.sliders[name].user_changed = true
                }
            })

            function userChanged (values) {
                if (debug) {
                    console.log('userChanged')
                }
                fdkButtonFilterShow.fdkButton(inputs[0])

                // Установка что произошли изменения
                mSearch2.sliders[name]['changed'] = true
                mSearch2.sliders[name]['user_changed'] = true

                // Установка значения
                mSearch2.sliders[name]['values'] = values

                // Вызываем submit
                $(inputs[0]).trigger('change')
            }

            this.noUiSlider.on('set.one', userChanged)

            function handlerInput (value) {
                switch (this.classList[0]) {
                    case 'slider-input-min':
                        self.noUiSlider.set([Number(value), null])
                        break
                    case 'slider-input-max':
                        self.noUiSlider.set([null, Number(value)])
                        break
                    default:
                        break
                }
            }

            // Listen to keydown events on the input field.
            inputs.forEach(function (input, handle) {
                input.addEventListener('change', function () {
                    if (debug) {
                        console.log('change')
                        console.log(this)
                    }
                    handlerInput.call(this, this.value)
                })

                input.addEventListener('keydown', function (e) {
                    var values = self.noUiSlider.get()
                    var value = Number(values[handle])
                    var steps = self.noUiSlider.steps()

                    if (debug) {
                        console.log('keydown')
                    }

                    // [down, up]
                    var step = steps[handle]
                    var position
                    // 13 is enter,
                    // 38 is key up,
                    // 40 is key down.
                    switch (e.which) {
                        case 13:
                            if (debug) {
                                console.log('keyword 13')
                            }
                            /// Кнопка работает по умолчанию
                            //self.handlerInput(this, this.value)
                            break
                        case 38:
                            if (debug) {
                                console.log('keyword 38')
                            }
                            // Get step to go increase slider value (up)
                            position = step[1]
                            // false = no step is set
                            if (position === false) {
                                position = 1
                            }
                            // null = edge of slider
                            if (position !== null) {
                                self.handlerInput.call(this, value + position)
                            }
                            break

                        case 40:

                            if (debug) {
                                console.log('keyword 40')
                            }
                            position = step[0]
                            if (position === false) {
                                position = 1
                            }
                            if (position !== null) {
                                self.handlerInput.call(this, value + position)
                            }
                            break
                    }
                })
            })

        }

        function ranges (min, max) {
            // Когда одинаковые значения
            if (min === max) {
                return {
                    'min': [min],
                    'max': [max]
                }
            }
            var ranges = {
                'min': min,
                'max': max
            }

            // Установка области для движения ползунка
            if (max > 15000) {
                ranges['80%'] = 15000
            }
            if (max > 100000) {
                ranges['90%'] = 100000
            }
            return ranges
        }

        return this
    }
}(jQuery))
