/**
 * Установить выбранную точку
 * @param slideIndex
 */
function esliderSetDot (slideIndex, mode) {
    mode = mode === 'slide_dot' ? 'slide_dot' : 'dot'
    var $el = $(this).closest('.item-img')
    switch (mode) {
        case 'dot':
            // Указываем только выбранную точку по индексу
            $el.find('.item-slider__dot').removeClass('active')
            $el.find('.item-slider__dot[data-index="' + slideIndex + '"]').addClass('active')
            break
        case 'slide_dot':
            // Выбираем нужный слайд
            slideIndex++;

            // Получаем свайпер и устанавливаем слайд
            $el.find('.eslider-list')[0].swiper.slideTo(slideIndex);

            // dot устанавливать не надо так как в событии slideChange он сам переключиться
            break
        default:
            break
    }
}

/**
 * Устанавливается зона
 * @returns {boolean}
 */
function esliderHoverZone () {
    esliderSetDot.call($(this), $(this).data('index'), 'slide_dot')
    return false
}

