function initProductPreviewsSlider(htmlNode) {
    const swiperNode = htmlNode.querySelector('.swiper')

    return new Swiper(swiperNode, {
        slidesPerView: 'auto',
        observer: true,
        observeParents: true,
        observeSlideChildren: true,
        watchOverflow: true,
        mousewheel: true,

        breakpoints: {
            576: {
                direction: 'vertical'
            }
        },

        navigation: {
            nextEl: '.swiper-button-next',
            prevEl: '.swiper-button-prev',
        },

        on: {
            init: function() {
                if (this.slides.length === 1) {
                    htmlNode.querySelector('.swiper-button-prev').remove()
                    htmlNode.querySelector('.swiper-button-next').remove()
                }
            }
        }
    })
}

function initDisplayControllers(display, swiper) {
    const prevBtn = display.querySelector('.swiper-button-prev')
    const nextBtn = display.querySelector('.swiper-button-next')

    prevBtn.addEventListener('click', function(evt) {
        evt.stopPropagation()
        setPreviewsActiveSlide(swiper, 'prev', display)
    })

    nextBtn.addEventListener('click', function(evt) {
        evt.stopPropagation()
        setPreviewsActiveSlide(swiper, 'next', display)
    })
}

function setPreviewsActiveSlide(swiper, direction, display) {
    const lastSlideIdx = swiper.slides.length - 1
    const activeSlideIdx = swiper.slides
        .findIndex(function(el) {
            return el.classList.contains('active')
        })

    resetActiveSlide(swiper, activeSlideIdx)

    switch (direction) {
        case 'prev': goToPrev()
            break
        case 'next': goToNext()
            break
    }

    function goToPrev() {
        if (activeSlideIdx === 0) { // go to the End
            updateActiveSlideTo(swiper, lastSlideIdx, display)
            swiper.slideTo(lastSlideIdx)
            return
        }

        updateActiveSlideTo(swiper, activeSlideIdx - 1, display)
        swiper.slideTo(activeSlideIdx - 1)
    }

    function goToNext() {
        if (activeSlideIdx === lastSlideIdx) { // go to the Start
            updateActiveSlideTo(swiper, 0, display)
            swiper.slideTo(0)
            return
        }

        updateActiveSlideTo(swiper, activeSlideIdx + 1, display)
        swiper.slideTo(activeSlideIdx + 1)
    }
}

function resetActiveSlide(swiper, idx) {
    swiper.slides[idx].classList.remove('active')
}

function updateActiveSlideTo(swiper, idx, display) {
    swiper.slides[idx].classList.add('active')
    updateDisplayContent(swiper.slides[idx], display)
}

function isImage(url) {
    const imageExtensions = ['jpeg', 'jpg', 'gif', 'png', 'webp'];
    for (var i = 0; i < imageExtensions.length; i++) {
        const el = imageExtensions[i]
        if (url.toLowerCase().includes('.' + el)) {
            return true
        }
    }

    return false;
}

function updateDisplayContent(activeSlide, display) {
    const container = display.querySelector('.presentation__display-content')
    const item = activeSlide.querySelector('[data-source]')

    const newNode = createMediaElement(
        item.dataset.source,
        item.dataset.zoom,
        item.dataset.poster
    )

    while (container.firstChild) {
        container.removeChild(container.firstChild)
    }

    container.appendChild(newNode)
}

function createMediaElement(source, zoom, poster) {

    // for images
    if (isImage(source)) {
        const div = document.createElement('div')

        const img = document.createElement('img')
        img.src = source
        img.loading = 'lazy'
        img.alt = ''
        img.classList.add('presentation__display-view')

        const canvas = document.createElement('div')
        canvas.classList.add('presentation__display-zoom')
        canvas.style.backgroundImage = 'url("' + zoom + '")'
        canvas.style.backgroundPosition = "0% 0%"

        // const saverImg = document.createElement('img')
        // saverImg.src = source
        // saverImg.loading = 'lazy'
        // saverImg.alt = ''
        // saverImg.classList.add('presentation__display-saver')

        div.appendChild(img)
        // if (zoom) div.appendChild(canvas)
        // div.appendChild(saverImg)

        return div
    }

    // for video
    const a = document.createElement('a')
    a.href = source
    a.dataset.fancybox = 'video-gallery'
    a.classList.add('video-link')

    if (source.includes('rutube')) {
        a.dataset.type='iframe'
        a.classList.add('_rt')
    } else {
        a.classList.add('_yt')
    }

    const img = document.createElement('img')
    img.src = poster
    img.loading = 'lazy'
    img.alt = ''

    a.appendChild(img)

    return a
}

function initClickHandlerOnSlide(display, swiper) {
    const slides = Array.from(swiper.el.querySelectorAll('.swiper-slide'))

    slides.forEach(function(slide) {
        slide.addEventListener('click', function() {
            const currentActiveIdx = slides.findIndex(function(el) {
                return el.classList.contains('active')
            })

            const newActiveIdx = slides.findIndex(function(el) {
                return el === slide
            })

            resetActiveSlide(swiper, currentActiveIdx)
            updateActiveSlideTo(swiper, newActiveIdx, display)
        })
    })
}

function addSwiperHandler(display, swiper) {
    var xDown = null
    var yDown = null

    function handleTouchStart(e) {
        xDown = e.touches[0].clientX
        yDown = e.touches[0].clientY
    }

    function handleTouchMove(e) {
        if (!xDown || !yDown) return

        const xUp = e.touches[0].clientX
        const yUp = e.touches[0].clientY

        const xDiff = xDown - xUp
        const yDiff = yDown - yUp

        if (Math.abs(xDiff) > Math.abs(yDiff)) {
            if (xDiff > 0) {
                setPreviewsActiveSlide(swiper, 'next', display)
            } else {
                setPreviewsActiveSlide(swiper, 'prev', display)
            }
        }

        xDown = null
        yDown = null
    }

    display.addEventListener('touchstart', handleTouchStart, false)
    display.addEventListener('touchmove', handleTouchMove, false)
}

