function initProductsPresentations(startedOnInitial) {
    const displays = document.querySelectorAll('.presentation__display')
    const swiperContainers = document.querySelectorAll('.presentation__previews-slider')

    if (!displays && !swiperContainers) return

    const swipers = Array.from(swiperContainers).map(function(htmlNode) {
        return initProductPreviewsSlider(htmlNode)
    })

    displays.forEach(function(display, idx) {
        const swiper = swipers[idx]

        initDisplayControllers(display, swiper) // Кнопки влево/вправо в мобильной версии на дисплее
        initClickHandlerOnSlide(display, swiper) // Смена картинки после клика по превью
        addSwiperHandler(display, swiper) // Смена картинки на дисплее при свайпах влево/вправо на мобильных
        // initZoom(display) // Добавляем зумминг картинки
        initShowFancybox(display, swiper) // Запускаем галерею Fancybox после клики по дисплею с картинкой
        // initPresentationSources(display, startedOnInitial)
        blockSimilarButtonBubbling() // Блокируем показ галереи после клика по кнопке Похожие
    })
}

