// Добавляет якорь в урл после клика по табу на карточке товара -- START
function tabAnchorClickHandler() {
    var tabs = Array.from(document
        .querySelectorAll('[data-anchor]'))

    for (let i = 0; i < tabs.length; i++) {
        tabs[i].addEventListener('click', handler)
    }

    function handler() {
        if (this.dataset.anchor !== '') {
            setAnchorToUrl(this.dataset.anchor)
        } else {
            removeAnchorFromUrl()
        }
    }
}

function setAnchorToUrl(anchor) {
    removeAnchorFromUrl()
    window.history.replaceState(
        null,
        null,
        window.location.href + '#' + anchor
    );
}

function removeAnchorFromUrl() {
    var currentUrl = window.location.href;
    var baseUrl, params

    if (currentUrl.indexOf('?') !== -1) {
        [baseUrl, params] = currentUrl.split('?');
    } else {
        baseUrl = currentUrl
    }

    // из baseUrl всегда вырезаем анкор
    baseUrl = cutAnchorFromString(baseUrl)

    if (params) {
        params = cutAnchorFromString(params)
        baseUrl = baseUrl + '?' + params
    }

    window.history.replaceState(null, null, baseUrl);
}

function cutAnchorFromString(str) {
    if (str.indexOf('#') !== -1) {
        return str.substring(0, str.indexOf("#"));
    }
    return str;
}
// Добавляет якорь в урл после клика по табу на карточке товара -- FINISH

// Скролл к табу после загрузки страницы Карточки товара -- START
function scrollToTabAnchor() {
    var anchor = getAnchorFromUrl();

    if (!anchor) return;

    var targets = document.querySelectorAll('[data-anchor="' + anchor + '"]');
    if (!targets) return;

    var page = $('html, body');
    var top, offset
    var target = $(targets[0])

    if (window.innerWidth <= 992 && $(targets[1])) {
        target = $(targets[1])
    }

    if (!target.offset()) return;

    top = target.offset().top

    if (window.innerWidth > 992) {
        offset = -100
    } else {
        offset = 50
    }

    setTimeout(function() {
        page.animate({
            scrollTop: top + offset
        }, 500)
    }, 500);
}

function getAnchorFromUrl() {
    var url = window.location.href;
    var anchor

    if (url.indexOf('#') !== -1) {
        anchor = url.substring(url.indexOf('#') + 1);
    } else {
        return null;
    }

    // Проверка на случай если анкор записал перед get параметрами
    if (anchor.indexOf('?') !== -1) {
        return anchor.substring(0, anchor.indexOf("?"));
    }

    return anchor;
}
// Скролл к табу после загрузки страницы Карточки товара -- FINISH

function smoothScrollToAnchor() {
    const links = document.querySelectorAll('a');

    links.forEach(link => {
        if (link.hash && link.hash.length > 1) {
            link.addEventListener("click", function (event) {
                event.preventDefault();

                const targetId = link.hash.slice(1);
                const targetElement = document.getElementById(targetId);

                if (targetElement) {
                    window.scrollTo({
                        top: targetElement.offsetTop - 200,
                        behavior: 'smooth'
                    });
                } else {
                    const anchorBtn = document.querySelector(`button[data-anchor="${targetId}"]`);
                    if (anchorBtn) {
                        anchorBtn.click();

                        const targetAnchorElement = document.querySelector(`[data-anchor="${targetId}"]`);
                        if (targetAnchorElement) {
                            window.scrollTo({
                                top: targetAnchorElement.offsetTop - 200,
                                behavior: 'smooth'
                            });
                        }
                    }
                }
            });
        }
    });
}

function checkScrollPosition() {
    if (window.innerWidth < 992) return;

    const fixedProduct = document.querySelector('.fixed_product');

    if (fixedProduct && window.scrollY >= 700) {
        fixedProduct.classList.add('_active');
    } else if (fixedProduct) {
        fixedProduct.classList.remove('_active');
    }
}

window.addEventListener('scroll', checkScrollPosition);

