function initAddMark() {
    // Маркеры
    Array.from(document.querySelectorAll('.add-mark'))
        .forEach(function(marker) {
            marker.addEventListener('click', function(e) {
                e.stopPropagation();
                e.preventDefault();
                showAddMarkTooltip(this);
            })
        });

    // Кнопки закрыть
    Array.from(document.querySelectorAll('.add-mark__close'))
        .forEach(function(button) {
            button.addEventListener('click', function(e) {
                e.stopPropagation();
                e.preventDefault();
                hideAddMarkTooltip(this);
            })
        });

    // Кнопки скопировать
    Array.from(document.querySelectorAll('.add-mark__copy'))
        .forEach(function(button) {
            button.addEventListener('click', function(e) {
                e.stopPropagation();
                e.preventDefault();
                copyAddMarkLink(this);
                showAddMarkCopiedMsd(this);
            })
        });
}

function showAddMarkTooltip(marker) {
    var tooltip = marker.querySelector('.add-mark__tooltip');
    tooltip.classList.add('show');
}

function hideAddMarkTooltip(button) {
    var tooltip = button.parentNode;
    tooltip.classList.remove('show');
}

function copyAddMarkLink(button) {
    var link = button.closest('.add-mark').dataset.link;
    var textarea = document.createElement('textarea');

    if (!link) {
        var closestAnchor = button.closest('a');
        link = closestAnchor.getAttribute('href');
    }

    textarea.value = link;
    document.body.appendChild(textarea);
    textarea.select();
    document.execCommand('copy');
    document.body.removeChild(textarea);
}

function showAddMarkCopiedMsd(button) {
    var text = button.querySelector('span').innerText;
    button.classList.add('disabled');
    button.querySelector('span').innerText = 'Скопировано';

    setTimeout(function() {
        button.classList.remove('disabled');
        button.querySelector('span').innerText = text;
    }, 3000);
}

function hideAddMarkAll() {
    document.addEventListener('click', function(e) {
    var target = event.target;

    if (target.closest('.add-mark')) return;

    Array.from(document.querySelectorAll('.add-mark__tooltip'))
        .forEach(function(tooltip) {
            tooltip.classList.remove('show');
        });
});
}

