// Работа со скроллом таблицы Сравнение -- START
$(document).ready(function() {
    var comparisonTable = $('.comparison-table');
    var comparisonButtons = $('.comparison-controller');

    // Срываем кнопки скролла таблицы сравнения, когда они ниже таблицы
    $(window).scroll(function() {
        if (comparisonTable.length) {
            var comparisonTableBottom = comparisonTable.offset()
                .top + comparisonTable.outerHeight();
            var comparisonButtonsBottom = $(comparisonButtons[0]).offset()
                .top + $(comparisonButtons[0]).outerHeight();

            if (comparisonButtonsBottom > comparisonTableBottom) {
                comparisonButtons.addClass('invisible');
            } else {
                comparisonButtons.removeClass('invisible');
            }
        }
    });

    // Управляем сроллом таблицы сравнения
    var container = $('.compare .clearfix');
    var offset = $('.comparison-table tr:first-child td:first-child').outerWidth(true);
    // var offset = 10;

    $(comparisonButtons[0]).on('click', function() {
        $(container).animate({
            scrollLeft: '-='+offset+'px'
        }, 300);
        setTimeout(checkComaprisonTableScroll, 500);
    });

    $(comparisonButtons[1]).on('click', function() {
        $(container).animate({
            scrollLeft: '+='+offset+'px'
        }, 300);
        setTimeout(checkComaprisonTableScroll, 400);
    });

    $(container).on('scroll', checkComaprisonTableScroll);
    $(window).on('resize', checkComaprisonTableScroll);

    // Проверяем нопки сролла. Нужны ли они вообще и
    // Еслить сролить больше нельзя, блокируем нопки
    function checkComaprisonTableScroll() {

        var containerWidht = $(container).width()
        var tableWidth = $(comparisonTable).width();

        // Скрываем кнопки скролла, если ширина таблицы меньше ее контейнера
        if (tableWidth < containerWidht) {
            $('.comparison-controllers').hide();
            return
        }

        $('.comparison-controllers').show();

        var scroll = $(container).scrollLeft() + $(container).width();
        var containerScrollLeft = $(container).scrollLeft();

        if (scroll >= tableWidth) {
            $(comparisonButtons[1]).addClass('disabled');
        } else {
            $(comparisonButtons[1]).removeClass('disabled');
        }

        if (containerScrollLeft > 0) {
            $(comparisonButtons[0]).removeClass('disabled');
        } else {
            $(comparisonButtons[0]).addClass('disabled');
        }

        if (tableWidth <= $(container).width()) {
            $('.comparison-controllers').css('dispaly', 'none');
        }
    }

    checkComaprisonTableScroll()
});
