// Обработка кликов по кнопкам вперед/назад
function handleMatchingControllers() {
	var prev = document.querySelector('.matching__controller-item_prev');
	var next = document.querySelector('.matching__controller-item_next');

	prev.addEventListener('click', function() {
		handleCheckMatchingControllerClick(1)
	});

	next.addEventListener('click', function() {
		handleCheckMatchingControllerClick(-1)
	});
}

// Обработчик кликов по кнопкам вперед/назад
function handleCheckMatchingControllerClick(direction) {

	var sticky = $('.matching__sticky .swiper-wrapper');
	var body = $('.matching__body .swiper-wrapper');
	var scrollbar = $('.matching__body .swiper-scrollbar-drag');
	var newSliderPos = getMatchingSlidePosition(direction, sticky);

	setMatchingDuration(body, sticky, scrollbar);
	setTimeout(function() {
		deleteMatchingDuration(body, sticky, scrollbar);
	}, 300);

	matchingStickySwiper.setTranslate(newSliderPos, 0);
	checkMatchingControllers();
}

// Включаем анимацию слайдинга для слайдеров
function setMatchingDuration(body, sticky, scrollbar) {
	body.css("transition-duration", "300ms");
	sticky.css("transition-duration", "300ms");
	scrollbar.css("transition-duration", "300ms");
}

// Отключаем анимацию слайдинга для слайдеров
function deleteMatchingDuration(body, sticky, scrollbar) {
	body.css("transition-duration", "0ms");
	sticky.css("transition-duration", "0ms");
	scrollbar.css("transition-duration", "0ms");
}

function getMatchingOfsetX(transformValue) {
	var startIndex = transformValue.indexOf("(");
	var endIndex = transformValue.indexOf(")");
	var transform = transformValue.substring(startIndex + 1, endIndex);
	return transform.split(", ")[4];
}

// Получаем новую позицию слайдера после клика по кнопкам вперед/назад
function getMatchingSlidePosition(direction, sticky) {
	var cellWidth = $('.matching td').outerWidth();
	var sliderCurrentOffsetX = parseFloat(getMatchingOfsetX(sticky.css("transform")));
	var swiperWidth = $(sticky).outerWidth();
	var slideWidth = $($(sticky).find('.matching__slide')).outerWidth();
	var maxOffset = -1 * (slideWidth - swiperWidth);
	var newOffset;

	// Если стоим ровно на карточке
	if (sliderCurrentOffsetX % cellWidth === 0) {
		newOffset = sliderCurrentOffsetX + cellWidth * direction;

	// Если стоим на части карточки (пользователь подвинул слайдер с помощью сролла)
	} else {
		var parts = Math.floor(Math.abs(sliderCurrentOffsetX) / cellWidth);
		if (direction < 0) parts++;
		if (parts === 0) return 0;
		newOffset = parts * cellWidth * -1;
	}

	if (newOffset > 0) return 0;
	if (newOffset < maxOffset) return maxOffset;

	return newOffset;
}

// Проверяем кнопки вперед/назади и отключаем, если слайдер вначале или вконце
function checkMatchingControllers() {
	setTimeout(function() {
		var sticky = $('.matching__sticky .swiper-wrapper');
		var prevBtn = $('.matching__controller-item_prev');
		var nextBtn = $('.matching__controller-item_next');
		var swiperWidth = $(sticky).outerWidth();
		var slideWidth = $($(sticky).find('.matching__slide')).outerWidth();
		var maxOffset = -1 * (slideWidth - swiperWidth - 5);
		var sliderCurrentOffsetX = parseFloat(getMatchingOfsetX(sticky.css("transform")));

		if (sliderCurrentOffsetX === 0) {
			prevBtn.addClass('disabled');
		} else {
			prevBtn.removeClass('disabled');
		}

		if (sliderCurrentOffsetX <= maxOffset) {
			nextBtn.addClass('disabled');
		} else {
			nextBtn.removeClass('disabled');
		}
	}, 300);
}

