// Удаляем товары из сравнения. Можно использовать эту функцию изолированно с асинхронным удалением
function deleteMatchingSell(node) {
    var cell = $(node).closest('td');
    var idx = $(cell).index() + 1;
    var lines = $('.matching__line');

    // Удаляем карточку товара
    $(cell).remove();

    // Удаляем соответствующие ячейки в таблице с данными
    $(lines).each(function(i, el) {
        $(el).find('td:nth-child('+ idx +')').remove();
    });

    // После удаления обновляем слайдеры
    matchingStickySwiper.update();
    matchingBodySwiper.update();

    matchingStickySwiper.slideTo(0);
    matchingBodySwiper.slideTo(0);

    // Проверяем есть ли товары для сравнения
    checkMatchingData();
}

// Проверяем есть ли товары для сравнения
function checkMatchingData() {
    var msg = $('.matching__empty-message');
    var match = $('.matching__wrap');
    var cells = $('.matching__sticky td').length;

    if (cells < 2) {
        $(msg).css('display', 'block');
        $(match).css('display', 'none');
    } else {
        $(msg).css('display', 'none');
        $(match).css('display', 'block');
    }
}

