// Фильтруем товары с отличиями
function initCheckMatchingDiff() {
    var btns = $('.matching__filter-controller');
    var same = $('[data-diff="same"]');

    $(btns).each(function(i, el) {
        $(el).on('click', function() {
            var filterVal = $(el).data('filter');
            var checkerAll = $('[data-filter="all"] .matching__filter-checker');
            var checkerDiff = $('[data-filter="diff"] .matching__filter-checker');

            $('.matching__filter-checker').removeClass('disabled');

            if (filterVal === 'diff') {
                checkerAll.addClass('disabled');
                $(same).addClass('hidden');

                if ($(window).width() > 767) {
                    paintMatchingOnDiff();
                }

                return;
            }

            if (filterVal === 'all') {
                checkerDiff.addClass('disabled');
                $(same).removeClass('hidden');
                resetPaintMatchingOnDiff();
                return;
            }
        })
    });
}

// Красим строки через одну в состоянии только отличия
function paintMatchingOnDiff() {
    var allBodyTables = $('.matching__body table');

    $(allBodyTables).each(function(i, table) {
        var lines = $(table).find('.matching__line:not(.hidden)');

        $(lines).each(function(i, tr) {
            if (i%2 === 0) {
                $(tr).addClass('not-painted');

            } else {
                $(tr).addClass('painted');
            }
        })
    })
}

// Брасываем окраску строк через одну для состояния только отличия
function resetPaintMatchingOnDiff() {
    $('.painted').removeClass('painted');
    $('.not-painted').removeClass('not-painted');
}

