// Страница каталоги
/**
 * Получает отфильтрованные заголовки каталогов на основе запроса.
 * В случае если запрос более одного символа (кнопка Показать все) возвращает массив со всеми заголовками,
 * в противном случае, фильтруем заголовки по первому символу.
 * @param {string} query - Строка запроса для фильтрации заголовков.
 * @returns {Array<string>} - Массив отфильтрованных заголовков каталогов.
 */
function getFilteredCatalogsTitles(query) {
    const titles = $('.card-title')
        .toArray()
        .map(title => title.innerText)

    if (query.length > 1) return titles

    return titles.filter(title =>
        title[0].toUpperCase() === query.toUpperCase())
}

/**
 * Прокручивает страницу к указанному узлу каталога.
 * @param {HTMLElement} node - Узел каталога, к которому нужно прокрутить страницу.
 */
function scrollToCatalog(node) {
    const SCROLL_DURATION = 700;
    const top = $(node).offset().top
    $("html, body").animate({
        scrollTop: top - 100
    }, SCROLL_DURATION)
}

/**
 * Переход к указанному каталогу на странице.
 * Ищем все каталоги, далее фильтруем согласно переданному параметру
 * Вызываем функцию scrollToCatalog для скролла страницы
 * Класс .accent подсвечивает выбранный каталог для улучшения UX.
 * @param {string} catalogTitle - Название каталога, к которому нужно перейти.
 */
function goToCatalog(catalogTitle) {
    const catalogsCards = $('.card_download_catalog')

    const targetCatalogCards = catalogsCards.filter((idx, card) => {
        const currentCatalogTitle = $(card).find('.card-title')[0].innerText
        return currentCatalogTitle ===catalogTitle
    })

    if (targetCatalogCards.length > 0) {
        scrollToCatalog(targetCatalogCards[0])
        $(targetCatalogCards[0]).addClass('accent')

        setTimeout(() =>
            $(targetCatalogCards[0]).removeClass('accent'),
            6000)
    }
}

/**
 * Динамически собирает список кнопок для выбора каталога.
 * Вешает на них события для перехода к нужному каталогу.
 * Обновляем DOM и показывает результат.
 * @param {Array} resultsArr - Array of catalog results to be displayed.
 */
function printFilteredCatalogsResults(resultsArr) {
    const resTrue = 'Найдено совпадений:'
    const resFalse = 'По Вашему запросу совпадений не найдено!'
    const results = $('.catalogs__results')
    const title = $(results).find('h4')
    const match = $(results).find('.catalogs__match')

    // At first, always hide results section
    $(results).removeClass('visible')
    $(match).removeClass('visible')

    // If there's no results, show results section with no results
    if (resultsArr.length === 0) {
        $(title).text(resFalse)
        $(results).addClass('visible')
        return
    }

    $(title).text(resTrue)
    $(match).empty()

    // Then show results section with actual results
    $(resultsArr).each((idx, catalog) => {
        const li = $(`<li>${catalog}</li>`)
        $(li).on('click', () => goToCatalog(catalog))
        match.append(li)
    })

    // After all manipulations, show results section
    $(results).addClass('visible')
    $(match).addClass('visible')
}

/**
 * Получает все кнопки алфавита, вешает на них событие клика.
 * Вызывает printFilteredCatalogsResults для отображения результатов фильтрации.
 */
function initCatalogsFilter() {
    const buttons = $('.catalogs__alphabet li, .catalogs__all')

    buttons.each((idx, button) => {
        $(button).on('click', () => {
            const isActive = $(button).hasClass('active')

            // Deactivate all buttons
            $(buttons).removeClass('active')

            if (isActive) {
                $(button).removeClass('active')
                $('.catalogs__results').removeClass('visible')
                $('.catalogs__match').removeClass('visible')
                return
            }

            const query = $(button).text()
            const resultsArr = getFilteredCatalogsTitles(query)
            printFilteredCatalogsResults(resultsArr)
            $(button).addClass('active')
        })
    })
}

window.addEventListener('load', initCatalogsFilter)

