function handleModalClose(modalSelector) {
    const modal = document.querySelector(modalSelector);

    if (!modal) return;

    document.addEventListener('click', (e) => {
        if (modal.style.display === 'block' && !e.target.closest('.modal-content')) {
            closeModal();
        }
    });

    modal.querySelector('[data-dismiss="modal"]').addEventListener('click', closeModal);

    function closeModal() {
        modal.classList.remove('in');
        modal.style.display = '';

        modal.querySelectorAll('input[type="checkbox"]').forEach((checkbox) => {
            checkbox.checked = false;
        });

        modal.querySelectorAll('.transfer-select_list._js-transfer-select-list').forEach((list) => {
            list.style.display = 'none';
        });

        modal.querySelectorAll('.transfer-select._js-transfer-select.active').forEach((select) => {
            select.classList.remove('active');
        });
    }
}

function initProjectDetailCalc() {
    document.addEventListener('click', (e) => {
        if (e.target.classList.contains('_js-myProjectDetail-calc-plus')) {
            const calcWrap = e.target.closest('.myProjectDetail-item_calc_wrap');
            const input = calcWrap.querySelector('._js-myProjectDetail-calc-value');
            const minusButton = calcWrap.querySelector('._js-myProjectDetail-calc-minus');

            if (input) {
                input.value = parseInt(input.value, 10) + 1;
                minusButton.disabled = false;
            }
        }

        if (e.target.classList.contains('_js-myProjectDetail-calc-minus')) {
            const calcWrap = e.target.closest('.myProjectDetail-item_calc_wrap');
            const input = calcWrap.querySelector('._js-myProjectDetail-calc-value');

            if (input) {
                const currentValue = parseInt(input.value, 10);
                input.value = currentValue > 1 ? currentValue - 1 : 1;

                if (parseInt(input.value, 10) === 1) {
                    e.target.disabled = true;
                }
            }
        }
    });
}

function updateProjectDetailTotal() {
    const projectItems = document.querySelectorAll('._js-myProjectDetail-item');

    projectItems.forEach(item => {
        const priceElements = item.querySelectorAll('._js-myProjectDetail-price');
        const calcInput = item.querySelector('._js-myProjectDetail-calc-value');
        const totalElement = item.querySelector('._js-myProjectDetail-total');

        if (!priceElements || !calcInput || !totalElement) return;

        let totalPrice = 0;
        priceElements.forEach(priceEl => {
            const priceText = priceEl.textContent.trim().replace(/\s|₽/g, '').replace(',', '.');
            const priceValue = parseFloat(priceText) || 0;
            totalPrice += priceValue;
        });

        const multiplier = parseInt(calcInput.value, 10) || 1;
        const finalTotal = totalPrice * multiplier;

        totalElement.textContent = `${finalTotal.toLocaleString('ru-RU', { style: 'currency', currency: 'RUB' })}`;
    });
}

function initProjectDetailCalculation() {
    document.addEventListener('input', (e) => {
        if (e.target.classList.contains('_js-myProjectDetail-calc-value')) {
            updateProjectDetailTotal();
        }
    });

    document.addEventListener('click', (e) => {
        if (
          e.target.classList.contains('_js-myProjectDetail-calc-plus') ||
          e.target.classList.contains('_js-myProjectDetail-calc-minus')
        ) {
            updateProjectDetailTotal();
        }
    });

    updateProjectDetailTotal();
}